import AppBar from '@mui/material/AppBar';
import {Button, Link} from "@mui/material";


function Navbar(){
    return (
        <AppBar>
            <Link to='/' style={{color : 'white'}}>Home</Link>
            <h3>Hi</h3>
            <Button>Home</Button>
        </AppBar>
    );

}

export default Navbar;
